<!doctype html>
<html lang="ar" dir="rtl">
<head>
<meta charset="utf-8"/>
<meta name="viewport" content="width=device-width,initial-scale=1"/>
<title>لوحة أسعار - شركة التبر الصافي العالمية (أجدابيا)</title>
<link rel="preconnect" href="https://fonts.googleapis.com">
<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
<link href="https://fonts.googleapis.com/css2?family=Noto+Sans+Arabic:wght@400;700;900&display=swap" rel="stylesheet">
<style>
#log{display:none!important;}

@import url('https://fonts.googleapis.com/css2?family=Tajawal:wght@700;900&display=swap');
.main-title{font-family:'Tajawal', sans-serif !important;}

  :root{ --bg:#071226; --card:#081327; --accent:#e7c84a; --muted:#a7b3bf; --pos:#1fa65a; --neg:#e65252; }
  html,body{height:100%;margin:0;background:var(--bg);color:#fff;font-family:'Noto Sans Arabic', system-ui, -apple-system, 'Segoe UI', Roboto, Arial, sans-serif;}
  .wrap{width:100%;height:100vh;display:flex;flex-direction:column;box-sizing:border-box;gap:14px;padding:18px}
  .header{display:flex;align-items:center;justify-content:space-between;gap:12px}
  .brand{display:flex;align-items:center;gap:12px}
  .logo{width:220px;height:80px;border-radius:8px;overflow:hidden;background:rgba(255,255,255,0.02);display:flex;align-items:center;justify-content:center;border:1px solid rgba(255,255,255,0.04)}
  .logo img{max-width:100%;max-height:100%;object-fit:contain;display:block}
  .titles{text-align:right}
  .title-main{font-size:34px;font-weight:900;color:var(--accent);margin:0}
  .title-sub{font-size:15px;color:var(--muted);margin-top:6px}
  .controls{display:flex;gap:8px;align-items:center}
  .btn{background:rgba(255,255,255,0.03);border:1px solid rgba(255,255,255,0.04);color:#fff;padding:8px 12px;border-radius:8px;cursor:pointer;font-weight:700}
  .input{background:rgba(255,255,255,0.02);border:1px solid rgba(255,255,255,0.04);color:#fff;padding:6px;border-radius:6px;min-width:260px}
  .stage{flex:1;display:flex;align-items:center;justify-content:center;overflow:hidden;padding:6px}
  .grid{display:grid;grid-template-columns:repeat(7,1fr);gap:14px;width:100%;max-width:1900px}
  .card{background:var(--card);border-radius:12px;padding:14px;display:flex;flex-direction:column;justify-content:space-between;min-height:140px;box-shadow:0 6px 24px rgba(0,0,0,0.6);border:1px solid rgba(255,255,255,0.03)}
  .row-top{display:flex;justify-content:space-between;align-items:center}
  .flag{font-size:34px}
  .code{font-weight:900;font-size:20px}
  .name{font-size:14px;color:var(--muted);margin-top:6px}
  .rate{font-size:34px;font-weight:900;margin-top:10px}
  .delta{font-size:13px;margin-top:8px;text-align:right}
  .delta .up{color:var(--pos)} .delta .down{color:var(--neg)}
  .infobar{display:flex;justify-content:space-between;align-items:center;padding:10px 14px;border-radius:10px;background:rgba(255,255,255,0.02);border:1px solid rgba(255,255,255,0.03);color:var(--muted)}
  .clock{font-weight:800}
  .log{position:fixed;left:12px;bottom:12px;background:rgba(0,0,0,0.5);padding:8px;border-radius:8px;color:#ddd;max-width:420px;max-height:38vh;overflow:auto;font-size:13px}
  .error{position:fixed;right:12px;top:12px;background:rgba(255,20,20,0.06);padding:10px;border-radius:8px;color:#ffd6d6;display:none;max-width:420px}
  @media(max-width:1500px){ .grid{grid-template-columns:repeat(4,1fr)} .title-main{font-size:28px} }
  @media(max-width:1000px){ .grid{grid-template-columns:repeat(3,1fr)} .rate{font-size:26px} .logo{width:140px;height:60px} }
</style>
</head>

<div class="log" id="log" aria-hidden="false"></div>
<div class="error" id="errorBox" role="alert"></div>

<script>
(() => {
  const CURRENCIES = [
    {code:'USD', name:'الدولار الأمريكي', flag:'🇺🇸'},
    {code:'EUR', name:'اليورو', flag:'🇪🇺'},
    {code:'TRY', name:'الليرة التركية', flag:'🇹🇷'},
    {code:'GBP', name:'الجنيه الإسترليني', flag:'🇬🇧'},
    {code:'AED', name:'الدرهم الإماراتي', flag:'🇦🇪'},
    {code:'TND', name:'الدينار التونسي', flag:'🇹🇳'},
    {code:'EGP', name:'الجنيه المصري', flag:'🇪🇬'}
  ];

  const mapNameToCode = {
    'الدولار الأمريكي':'USD','اليورو':'EUR','الجنيه الاسترليني':'GBP',
    'الليرة التركية':'TRY','الدرهم الإماراتي':'AED','الدينار التونسي':'TND','الجنيه المصري':'EGP'
  };

  const CBL_AR = 'https://cbl.gov.ly/currency-exchange-rates/';
  const CBL_EN = 'https://cbl.gov.ly/en/currency-exchange-rates/';
  const FALLBACKS = ['https://api.allorigins.win/raw?url=','https://thingproxy.freeboard.io/fetch/'];

  const grid = document.getElementById('grid');
  const logEl = document.getElementById('log');
  const errorBox = document.getElementById('errorBox');
  const syncEl = document.getElementById('sync');
  const clockEl = document.getElementById('clock');
  const themeSel = document.getElementById('themeSel');
  const proxyInput = document.getElementById('proxyInput');
  const saveProxyBtn = document.getElementById('saveProxy');
  const fullBtn = document.getElementById('fullscreen');
  const refreshBtn = document.getElementById('refresh');

  function safeLog(msg){ try{ logEl.innerHTML = new Date().toLocaleTimeString() + ' — ' + msg + '<br>' + logEl.innerHTML; console.log(msg);}catch(e){} }
  function showError(msg){ try{ errorBox.style.display='block'; errorBox.textContent = msg; setTimeout(()=> errorBox.style.display='none',8000);}catch(e){} }

  // build cards
  function buildGrid(){ grid.innerHTML=''; CURRENCIES.forEach(c=>{ const card=document.createElement('div'); card.className='card'; card.id='card-'+c.code; card.innerHTML = `
    <div class="row-top">
      <div>
        <div class="code">${c.code}</div>
        <div class="name">${c.name}</div>
      </div>
      <div class="flag">${c.flag}</div>
    </div>
    <div class="rate" id="rate-${c.code}">--</div>
    <div class="delta" id="delta-${c.code}"><span style="opacity:0.6">—</span></div>
  `; grid.appendChild(card); }); }
  buildGrid();

  // themes
  const THEMES = [
    {'--bg':'#071226','--card':'#081327','--accent':'#e7c84a','--muted':'#a7b3bf','--pos':'#1fa65a','--neg':'#e65252'},
    {'--bg':'#071017','--card':'#0f1418','--accent':'#6aa6d8','--muted':'#9aa7b0','--pos':'#2fb48c','--neg':'#e35b5b'},
    {'--bg':'#000000','--card':'#111214','--accent':'#f1d07a','--muted':'#9b9fa6','--pos':'#24b66b','--neg':'#ef6b6b'},
    {'--bg':'#071716','--card':'#08201c','--accent':'#7fd1b4','--muted':'#9fc7b8','--pos':'#2fb48c','--neg':'#f36b7a'},
    {'--bg':'#071b2a','--card':'#071827','--accent':'#7fb9e6','--muted':'#9fbad0','--pos':'#3fc18f','--neg':'#f36b7a'}
  ];
  function applyTheme(i){ const t = THEMES[i] || THEMES[0]; Object.keys(t).forEach(k=>document.documentElement.style.setProperty(k,t[k])); localStorage.setItem('lyd-theme',i); }
  themeSel.addEventListener('change', ()=> applyTheme(Number(themeSel.value)));
  try{ const st = localStorage.getItem('lyd-theme'); if(st) themeSel.value = st, applyTheme(Number(st)); }catch(e){}

  // clock
  function tick(){ try{ clockEl.textContent = new Date().toLocaleTimeString('ar-LY'); }catch(e){} }
  tick(); setInterval(tick,1000);

  // prev values
  let prev = {};
  try{ prev = JSON.parse(localStorage.getItem('lyd-prev')||'{}'); }catch(e){ prev = {}; }

  function fmt(n){ try{return Number(n).toLocaleString('ar-LY',{minimumFractionDigits:3,maximumFractionDigits:3}); }catch(e){ return n; } }

  function parseDoc(txt){
    try{
      const doc = new DOMParser().parseFromString(txt,'text/html');
      const rows = Array.from(doc.querySelectorAll('table tbody tr'));
      const parsed = {};
      rows.forEach(tr=>{
        const tds = Array.from(tr.querySelectorAll('td')).map(td=>td.textContent.trim());
        if(tds.length < 2) return;
        const hasNum = s=>/[0-9]/.test(s);
        const name = tds.find(s=> !hasNum(s) && s.length>0 && s.length<40);
        const nums = tds.filter(hasNum).map(s=> Number((s||'').replace(/[^0-9.]/g,'')));
        if(!name || nums.length<1) return;
        const code = mapNameToCode[name];
        if(!code) return;
        parsed[code] = { avg: nums[0], sell: nums[1] ?? nums[0], buy: nums[2] ?? nums[0] };
      });
      return { parsed, asOf: new Date().toISOString() };
    }catch(e){ return { parsed:{}, asOf:new Date().toISOString() }; }
  }

  async function fetchText(url){
    const res = await fetch(url, {mode:'cors'});
    if(!res.ok) throw new Error('status '+res.status);
    return await res.text();
  }

  async function tryDirect(){
    try{ safeLog('محاولة مباشر AR'); const t=await fetchText(CBL_AR); const p=parseDoc(t); if(Object.keys(p.parsed).length) return {p,source:'direct-AR'} }catch(e){ safeLog('direct-AR failed:'+e.message); }
    try{ safeLog('محاولة مباشر EN'); const t=await fetchText(CBL_EN); const p=parseDoc(t); if(Object.keys(p.parsed).length) return {p,source:'direct-EN'} }catch(e){ safeLog('direct-EN failed:'+e.message); }
    return null;
  }

  async function tryCustomProxy(target){
    const custom = (localStorage.getItem('lyd-proxy')||'').trim();
    if(!custom) return null;
    safeLog('تجربة البروكسي المخصص');
    const patterns = [ custom + encodeURIComponent(target), custom + '?u=' + encodeURIComponent(target) ];
    for(const u of patterns){
      try{ const t = await fetchText(u); const p = parseDoc(t); if(Object.keys(p.parsed).length) return {p,source:u}; }catch(e){ safeLog('proxy failed:'+e.message); }
    }
    return null;
  }

  async function tryFallbacks(target){
    for(const base of FALLBACKS){
      try{ safeLog('تجربة ممر: '+base); const t = await fetchText(base + encodeURIComponent(target)); const p = parseDoc(t); if(Object.keys(p.parsed).length) return {p,source:base}; }catch(e){ safeLog('fallback failed:'+e.message); }
    }
    return null;
  }

  function applyParsed(parsedObj, asOf, sourceLabel){
    try{
      const parsed = parsedObj || {};
      CURRENCIES.forEach(c=>{
        const rateEl = document.getElementById('rate-'+c.code);
        const deltaEl = document.getElementById('delta-'+c.code);
        const val = parsed[c.code] ? parsed[c.code].avg : (prev[c.code] || 0);
        if(rateEl){ rateEl.textContent = fmt(val) + ' LYD'; rateEl.classList.add('updating'); setTimeout(()=> rateEl.classList.remove('updating'),900); }
        const p = prev[c.code];
        if(deltaEl){
          if(p === undefined) deltaEl.innerHTML = '<span style="opacity:0.6">—</span>';
          else {
            const diff = val - p;
            const pct = p? (diff/p*100):0;
            if(diff>0) deltaEl.innerHTML = `<span class="up">▲ ${diff.toFixed(3)} (${pct.toFixed(2)}%)</span>`;
            else if(diff<0) deltaEl.innerHTML = `<span class="down">▼ ${Math.abs(diff).toFixed(3)} (${pct.toFixed(2)}%)</span>`;
            else deltaEl.innerHTML = '<span style="opacity:0.6">—</span>';
          }
        }
        prev[c.code] = val;
      });
      localStorage.setItem('lyd-prev', JSON.stringify(prev));
      syncEl.textContent = 'المصدر: مصرف ليبيا المركزي · آخر مزامنة: ' + (asOf? new Date(asOf).toLocaleString('ar-LY') : new Date().toLocaleString('ar-LY')) + (sourceLabel? ' · مصدر: ' + sourceLabel : '');
    }catch(e){ safeLog('applyParsed error:'+ (e.message||e)); }
  }

  async function refreshAll(){
    try{
      networkStatus('جارٍ التحديث...');
      safeLog('بدء التحديث');
      const direct = await tryDirect();
      if(direct){ applyParsed(direct.p.parsed, direct.p.asOf, direct.source); networkStatus('اتصال مباشر'); safeLog('نجح: '+direct.source); return; }
      const custom = await tryCustomProxy(CBL_AR);
      if(custom){ applyParsed(custom.p.parsed, custom.p.asOf, custom.source); networkStatus('بروكسي مخصص'); safeLog('نجح عبر بروكسي'); return; }
      const fb = await tryFallbacks(CBL_AR);
      if(fb){ applyParsed(fb.p.parsed, fb.p.asOf, fb.source); networkStatus('ممر احتياطي'); safeLog('نجح عبر ممر'); return; }
      networkStatus('تعذّر الوصول للمصدر — عرض آخر القيم المحلية');
      safeLog('فشل كل المحاولات — عرض محلي');
      applyParsed(null,null,null);
      showError('تعذّر الوصول للمصدر — عرض آخر القيم المحلية');
    }catch(err){ showError('خطأ أثناء التحديث: '+(err&&err.message?err.message:String(err))); console.error(err); }
  }

  function networkStatus(s){ try{ syncEl.textContent = 'المصدر: مصرف ليبيا المركزي · آخر مزامنة: — · ' + s; }catch(e){} }

  // events
  fullBtn && fullBtn.addEventListener('click', ()=>{ try{ if(document.documentElement.requestFullscreen) document.documentElement.requestFullscreen(); else document.documentElement.webkitRequestFullscreen(); }catch(e){}});
  refreshBtn && refreshBtn.addEventListener('click', refreshAll);
  saveProxyBtn && saveProxyBtn.addEventListener('click', ()=>{ const v = proxyInput.value.trim(); localStorage.setItem('lyd-proxy', v); safeLog('بروكسي محفوظ'); });
  proxyInput && (proxyInput.value = localStorage.getItem('lyd-proxy')||'');

  if(Object.keys(prev).length) applyParsed(null,null,'محلي');
  setTimeout(refreshAll,800);
  setInterval(refreshAll,60*1000);

  window.addEventListener('error', (ev)=>{ showError('خطأ في الصفحة: '+(ev.message||'')); safeLog('window.error: '+(ev.message||'')); });
  window.addEventListener('unhandledrejection', (ev)=>{ showError('خطأ غير معالج'); safeLog('unhandledRejection: '+(ev.reason||'')); });

})(); // IIFE
</script>
</body>
</html>
